import React from "react";
import "./FooterGov.scss"

const FooterGov = () => {
    return (
        <footer className="FooterGov">
            <nav className="bg-color-marine pt-4 pb-4 footer-final">
                <div className="container">
                <a href="https://www.gov.co" Target="_blank">
                                    <img className="img-puntogov" alt="logo de GovCo" src="https://postdata.gov.co/sites/all/themes/nuboot_radix/assets/images/header_govco.png" /> 
                                </a>
                    <a className="navbar-brand" href="https://www.gov.co/">
                        <img className="logogov" src="https://cdn.www.gov.co/assets/images/logo.png" alt="Logo Gov.co" />
                    </a>
                </div>
            </nav>
        </footer>
    );
}

export default FooterGov;
